import React from 'react';
import Button from 'react-bootstrap/Button';
import Sidebar from '../components/sidebar';

export default function ToDO() {
    return (
        
        <div>
            <h1>To Do List</h1>
            <Button variant="primary">Add Task</Button>
            <Sidebar/>
        </div>
    );
}
